import React from "react"
import home from '../img/home.jpg'





class Navbar extends React.Component{
    render(){
        return(
            <div style={{ backgroundImage: `url(${home})` }}>
                <section id="header" className="dark">
                    <header>
                        <h1>What it means to meditate</h1>
                        <p>Are you stressed? take a walk far from home and find a serene place to think about everything.
                        </p>
                    </header>
                </section>
            </div>
        )
    }
}

export default Navbar
